import React from 'react';

function RowTable (props){
    
    const Keys = Object.keys(props.dataRow);
    const uid = props.dataRow.uid;
    console.log("uid tr ", uid);
    
    return(
            <tr>
            {
              Keys.map( (keys, index)=>{
                return <td key = {index} uid = {uid} >
                            {props.dataRow[keys]}
                        </td>
            }) 
            }
        
        </tr>
    )
}

export default RowTable
